import React from 'react';
import User from './User';
import './css/users.css'

// zasto tu moram eksplicitno napisat users i zasto moram destruktuirat
const Users = ({users}) => {
    return(
        <div id='usersContainer'>
            {
                users.map( (element, i) => {
                    return <User 
                    id = {users[i].id}
                    name={users[i].name} 
                    username={users[i].username}
                    email={users[i].email}
                    /> 
                })
            }
            <button style={{display}}>Delete all</button>
        </div>
    );
}

export default Users;
